import Commercial from './pages/Commercial';
import ForSale from './pages/ForSale';
import Rent from './pages/Rent';
import Roommates from './pages/Roommates';

const RouteShortHand = ({path,comp})=> (
  <Route exact path={path}>{child}</Route>
);


class App extends React.Component {

  componentDidMount() {
    fetch("/api/test")
      .then(res => res.text()).then(test => {
        console.log(test);
      })
  }
  render() {
    return (
      <div className="App">
        <BrowserRouter>
        <Header></Header>
          <RouteShortHand path="/forsale" comp={<ForSale/>}/>
          <RouteShortHand path="/rent" comp={<Rent/>}/>
          <RouteShortHand path="/
          " comp={<Commercial/>}/>
          <RouteShortHand path="/forsale" comp={<Roommates/>}/>
        </BrowserRouter>
      </div>
    );
  }
}



export default App;
